import ReactPlayer from 'react-player';
import videoFile from './resources/vid.mp4';

const Video = () => {
    return (
        <div style={{ textAlign: 'center', marginTop: '20px' }}>
          <ReactPlayer url={videoFile}/>
        </div>
      );
};

export default Video;
